import React,{Component} from 'react';
import './App.css';
import Particles from 'react-particles-js';
import Navigation from './Navigation/navigation';
import Logo from './LOGO/Logo';
import Imag from './Image/Image';
import Rank from './rank/Rank' ;
//import Facedetect from './facedetection';
const particlesop = {
  particles: {
    number: {
      value : 25,
      density :{
        enable: true,
        value_area: 700 
      }

    } ,
    line_linked: {
      shadow: {
        enable: true,
        color: "#3CA9D1",
        blur: 5
      }
    }
  }
}
class App extends Component{

  render(){
      return (
    <div className="App">
      <Particles 
                params={particlesop} style={{position:'absolute' , zindex : '-1'}} />
     <Navigation />
     <Logo />
     <Rank />
     <Imag />
    {/* <Facedetect /> */}
    </div>
  ); }
}

export default App;
